import logo from './logo.svg';
import './App.css';
import Home from './Home';
import { Route, Routes } from 'react-router-dom';

function App() {
  return (
    <div>
      <Route path='/' element={<Home></Home>}></Route>

      <BrowserRouter>
      <Routes>
      <Route path='/' element={<Home></Home>}></Route>
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
